import React from 'react'
import "./SidebarOptions.css";
//rfce
function SidebarOptions({Icon,title,number}) {
  return (
    <div className='sidebaroptions'>
      <Icon />
      <h2>{title}</h2>
      <p>{number}</p>
    </div>
  )
}

export default SidebarOptions;
